  }, ": \uBE44\uACF5\uAC1C\uB85C \uB0A8\uC544\uC788\uC5C8\uB358 \uAE00")), mdx("hr", null), mdx("p", null, "11\uC6D4 1\uC77C. \uC0C8\uB85C\uC6B4 \uB2EC\uC774 \uC2DC\uC791\uB418\uC5C8\uB2E4. \uC0C8\uBCBD 5\uC2DC 30\uBD84\uC5D0 \uC77C\uC5B4\uB098 \uC5B4\uB450\uC6B4 \uC0C8\uBCBD\uC744 \uB6AB\uACE0 \uC218\uC601\uC7A5\uC5D0 \uD5A5\uD588\uB2E4. \uC624\uB298\uBD80\uD130 \uAC15\uC2B5\uC774 \uC2DC\uC791\uB418\uB294 \uB0A0\uC774\uAE30 \uB54C\uBB38\uC774\uB2E4. 6\uC2DC 10\uBD84\uBD80\uD130 \uC218\uC5C5\uC774\uB77C \uC801\uC5B4\uB3C4 6\uC2DC\uC5D0\uB294 \uB3C4\uCC29\uD574\uC11C \uC53B\uACE0 \uC218\uC601\uC7A5\uC5D0 \uB4E4\uC5B4\uAC00 \uC788\uC5B4\uC57C \uD55C\uB2E4. \uB4DC\uB514\uC5B4 \uAC15\uC2B5\uC744 \uB4E3\uAE30 \uC2DC\uC791\uD558\uB2C8, \uBB34\uC5C7\uC778\uAC00 \uC0C8\uB86D\uB2E4. \uC218\uC601\uD558\uB294 \uC2DC\uAC04\uBCF4\uB2E4 \uCCB4\uC628 \uC870\uC808\uD0D5\uC5D0 \uB4E4\uC5B4\uAC00\uC788\uB294 \uC2DC\uAC04\uC774 \uB354 \uB9CE\uC544\uC9C0\uACE0 \uC788\uB294 \uD0C0\uC774\uBC0D\uC774\uC5C8\uB294\uB370, \uAC15\uC2B5\uC73C\uB85C \uC778\uD574\uC11C \uD6A8\uC728\uC801\uC778 \uC218\uC601\uC774 \uB420 \uC218 \uC788\uC744 \uAC83 \uAC19\uB2E4. 50\uBD84\uAC04\uC758 \uC9E7\uC740 \uC2DC\uAC04\uC774\uC9C0\uB9CC, \uD769\uD2B8\uB7EC\uC838\uC788\uB358 \uB098\uC758 \uC218\uC601 \uC790\uC138\uB97C \uBC14\uB85C \uC7A1\uB294 \uB300 \uB9CE\uC740 \uB3C4\uC6C0\uC774 \uB41C \uAC83 \uAC19\uB2E4. \uC544\uBB34\uB798\uB3C4 \uCD08\uB4F1\uD559\uAD50 \uB54C \uBC30\uC6B4 1\uAC1C\uC6D4\uC758 \uC9E7\uC740 \uC218\uC601 \uAC15\uC2B5\uACFC \uC218\uB144\uAC04\uC758 \uACF5\uBC31, \uADF8\uB9AC\uB85C \uBA87 \uAC1C\uC6D4\uAC04\uC758 \uC790\uC720 \uC218\uC601\uC73C\uB85C \uC778\uD574 \uC790\uC138\uAC00 \uB9CE\uC774 \uC88B\uC9C0 \uC54A\uC558\uC5C8\uB358 \uAC83 \uAC19\uB2E4. \uADF8\uB9AC\uACE0 \uC624\uB79C\uB9CC\uC5D0 \uB2E4\uB978 \uC0AC\uB78C\uB4E4\uACFC \uAC19\uC774 \uBB34\uC5C7\uC778\uAC00 \uD55C\uB2E4\uB294 \uAC83\uC5D0 \uB300\uD574 \uC2E0\uC120\uD558\uB2E4\uACE0 \uB290\uAF08\uB2E4. \uC55E\uC73C\uB85C \uAFB8\uC900\uD788 \uC798 \uB2E4\uB140\uC11C \uBC14\uB978 \uC790\uC138\uB85C \uBA4B\uC9C4 \uC218\uC601\uC744 \uD574\uC57C\uACA0\uB2E4."), mdx("p", null, "\uD558\uB8E8\uD558\uB8E8 \uBB34\uC5C7\uC744 \uC704\uD574 \uC0B4\uC544\uAC00\uACE0 \uC788\uB294 \uAC83\uC77C\uAE4C. \uD558\uB8E8\uD558\uB8E8 \uACC4\uD68D\uC744 \uC138\uC6B0\uACE0 \uBB34\uC5C7\uC778\uAC00\uB97C \uD558\uACA0\uB2E4\uB294 \uB2E4\uC9D0\uC744 \uD558\uB294 \uC2DC\uAC04\uC774 \uD544\uC694\uD55C \uAC83 \uAC19\uB2E4. \uC694 \uBA87\uC77C \uC0C8, \uC601\uD6C8\uC774\uB294 \uC13C\uD140\uC2DC\uD2F0\uB85C \uC678\uC8FC\uB97C \uD558\uB85C \uAC00\uACE0, \uC7AC\uD638 \uD584\uB3C4 \uB9CE\uC774 \uBC16\uC73C\uB85C \uB2E4\uB2C8\uC2DC\uB2E4\uBCF4\uB2C8 \uB098\uB3C4 \uC660\uC9C0 \uBAA8\uB974\uAC8C \uB9C8\uC74C\uC774 \uC2F1\uC22D\uC0DD\uC22D\uD55C \uAC83 \uAC19\uB2E4. \uBB34\uC5C7\uC744 \uD574\uC57C\uB420\uC9C0 \uBAA8\uB974\uACA0\uB2E4. \uC548\uB4DC\uB85C\uC774\uB4DC\uB97C \uC218\uC815\uD558\uACE0 \uC5C5\uADF8\uB808\uC774\uB4DC\uB97C \uC2DC\uCF1C\uC57C \uD558\uB294\uB370, \uAC11\uC790\uAE30 \uB370\uB4DC\uB77C\uC778\uC774 \uC0AC\uB77C\uC9C0\uC790, \uADF8 \uC9D1\uC911\uB825\uC774 \uB9CE\uC774 \uB5A8\uC5B4\uC84C\uB2E4. \uADF8\uB9AC\uACE0 \uC0C1\uD6C8\uC774 \uD504\uB85C\uC81D\uD2B8\uB97C \uB3C4\uC640\uC8FC\uAE30\uB85C \uD588\uC5C8\uB294\uB370, \uC0DD\uAC01\uBCF4\uB2E4 \uC591\uC774 \uB9CE\uC544\uC11C \uADF8\uAC78 \uD558\uAE30\uB3C4 \uC5C4\uB450\uAC00 \uC548\uB09C\uB2E4. \uADF8\uB9AC\uACE0 \uCD08\uBC18\uC5D4 \uC9D1\uC911\uB825\uC774 \uD544\uC694\uD55C \uAC83\uC774\uB77C \uC2DC\uAC04\uC744 \uB0B4\uAE30\uAC00 \uC870\uAE08 \uD798\uB4E4\uB2E4. \uC660\uC9C0 \uD68C\uC0AC\uC5D0 \uC640\uC11C\uB294 \uD558\uBA74 \uC548\uB420 \uAC83 \uAC19\uACE0, \uC9D1\uC5D0 \uAC00\uBA74 \uC2DC\uAC04\uC774 \uB2A6\uC5B4 \uC26C\uACE0 \uC2F6\uC740 \uB9C8\uC74C\uC774 \uCEE4\uC9C4\uB2E4. \uADFC\uB370 \uD68C\uC0AC\uC5D0\uC11C \uBB34\uC5C7\uC778\uAC00 \uD55C\uC77C\uC774 \uC880 \uC5C6\uAC70\uB098 \uC5EC\uC720\uB85C\uC6B0\uBA74 \uC0C1\uD6C8\uC774\uC758 \uD504\uB85C\uC81D\uD2B8\uC5D0 \uB300\uD55C \uC0DD\uAC01\uC744 \uD558\uAC8C \uB41C\uB2E4. \uB370\uC774\uD130 \uAD6C\uC870\uC640 \uC11C\uBC84\uC5D0 \uB300\uD574\uC11C \uC0DD\uAC01\uD558\uAC8C \uB418\uB294 \uAC83\uC774\uB2E4. \uB450 \uAC00\uC9C0 \uC77C\uC744 \uD558\uAC8C \uB418\uB294 \uC77C. \uC608\uC804\uC5D0\uB3C4 \uC774\uB7F0\uC2DD\uC73C\uB85C \uD55C\uBC88 \uD588\uB358 \uC801\uC774 \uC788\uB294 \uAC83 \uAC19\uB2E4. \uD30C\uC774\uBE0C\uC53D\uD06C\uB97C \uD558\uACE0 \uC788\uC744 \uB54C, \uAC11\uC790\uAE30 \uB3D9\uC778\uC774\uAC00 \uC81C\uC2DC\uD55C \uB098\uB204\uBBF8\uC548\uACFC \uC0C1\uD6C8\uC774\uC758 \uC9C0\uD551 \uD504\uB85C\uC81D\uD2B8\uB97C \uAC19\uC774 \uD558\uBA74\uC11C \uC774\uB9AC\uC800\uB9AC \uBC14\uC058\uAC8C \uD588\uB358 \uAC83\uC774 \uC0DD\uAC01\uB09C\uB2E4. \uADF8\uB54C \uB098\uB294 \uC544\uC8FC \uC990\uAC81\uACE0 \uC7AC\uBC0C\uAC8C \uC5EC\uB7EC\uAC00\uC9C0 \uC77C\uC744 \uD558\uB294 \uAC83\uC5D0 \uB300\uD574 \uAE0D\uC815\uC801\uC73C\uB85C \uC0DD\uAC01\uD558\uACE0 \uC788\uC5C8\uB294\uB370, \uAC19\uC774 \uD558\uB294 \uB2E4\uB978 \uC0AC\uB78C\uB4E4\uC740 \uADF8 \uC0AC\uC2E4\uC5D0 \uB300\uD574 \uC5B4\uB5BB\uAC8C \uC0DD\uAC01\uD588\uC744 \uC9C0 \uC0DD\uAC01\uD574\uBCF4\uBA74 \uC57D\uAC04 \uC88B\uC9C0 \uC54A\uC740 \uAC83 \uAC19\uB2E4\uB294 \uC0DD\uAC01\uC774 \uB4E0\uB2E4. \uB204\uAD6C\uB294 \uC9D1\uC911\uC744 \uD574\uC11C \uD55C\uAC00\uC9C0\uC77C\uC744 \uD558\uACE0 \uC788\uB294\uB370, \uB2E4\uB978 \uC0AC\uB78C\uC740 \uC5EC\uB7EC\uAC00\uC9C0\uC77C\uC744 \uB3D9\uC2DC\uC5D0 \uD558\uACE0 \uC788\uC73C\uB2C8 \uB9D0\uC774\uB2E4. \uADF8\uB7F0\uB370 \uD604\uC7AC\uB294 \uC0C1\uD6C8\uC774\uB97C \uB3C4\uC640\uC8FC\uC9C0 \uC54A\uC744 \uC218 \uC5C6\uB294 \uC0C1\uD0DC\uC774\uB2E4. \uCE74\uCE74\uC624\uD1A1 \uC81C\uD734\uB97C \uD558\uAE30 \uC704\uD574 \uAC8C\uC784\uC744 \uB9CC\uB4E4\uACE0 \uC788\uB294\uB370, \uC11C\uBC84 \uB54C\uBB38\uC5D0 \uC9C4\uD589\uC744 \uD560 \uC218 \uC5C6\uAC8C \uB418\uBA74 \uC548\uB418\uAE30 \uB54C\uBB38\uC774\uB2E4. \uCC98\uC74C\uC5D0\uB294 \uAC04\uB2E8\uD560 \uC904 \uC54C\uC558\uB358 \uBD80\uBD84\uC774 \uC810\uC810 \uB9CE\uC544\uC9C0\uBA74\uC11C \uD574\uC57C\uD560\uC77C\uC774 \uB300\uD3ED \uB298\uC5B4\uB09C \uAC83\uC774 \uC880 \uBD80\uB2F4\uC774 \uB418\uAE34 \uD558\uC9C0\uB9CC, \uC0C1\uD6C8\uC774\uC758 \uC131\uACF5\uC5D0 \uD55C\uBAAB \uD558\uACE0 \uC2F6\uB2E4\uB294 \uAC83\uACFC \uD639\uC2DC \uBAA8\uB97C \uB300\uBC15\uC5D0 \uB300\uBE44\uD574 \uBC1C\uC744 \uC5B9\uC5EC\uB193\uB294 \uAC83\uC774 \uC88B\uACA0\uB2E4\uB294 \uC0DD\uAC01 \uB4F1 \uC5EC\uB7EC\uAC00\uC9C0 \uC0DD\uAC01\uC774 \uC0C1\uD6C8\uC774\uB97C \uB3C4\uC640\uC918\uC57C\uACA0\uB2E4\uB294 \uACB0\uC2EC\uC744 \uD558\uAC8C \uB9CC\uB4E0 \uAC83 \uAC19\uB2E4. \uB300\uBC15\uC774 \uB098\uBA74 \uCD95\uD558\uD558\uACE0 \uBC18\uAE38 \uAC83 \uAC19\uC73C\uBA74\uC11C\uB3C4 \uBC30\uB3C4 \uC544\uD50C \uAC83 \uAC19\uB2E4\uB294 \uC0DD\uAC01\uC774\uB2E4. \uB098\uBCF4\uB2E4 \uB354 \uBE68\uB9AC \uC131\uACF5\uD560 \uAC83 \uAC19\uB2E4\uB294 \uC0DD\uAC01 \uB54C\uBB38\uC5D0. \uADF8\uB798\uB3C4 \uB0B4\uAC00 \uAC00\uC9C4 \uAE30\uC220\uC744 \uC774\uC6A9\uD574 \uCE5C\uAD6C\uB97C \uC544\uB08C\uC5C6\uC774 \uB3C4\uC640\uC8FC\uB294 \uAC83\uC774 \uB9DE\uACA0\uC9C0? \uB0B4\uAC00 \uAC00\uC9C4 \uAE30\uC220\uC744 \uC228\uAE30\uAC70\uB098 \uB3C4\uC640\uC8FC\uC9C0 \uC54A\uC73C\uB824\uB294 \uB9C8\uC778\uB4DC\uB294 \uC88B\uC9C0 \uC54A\uC740 \uAC83 \uAC19\uB2E4. \uB098\uB204\uACE0 \uBCA0\uD478\uB294 \uC0AC\uC774\uC5D0 \uB09C \uB354 \uD070 \uBC1C\uC804\uC744 \uD558\uAC8C \uB420 \uAC83\uC774\uB77C \uC0DD\uAC01\uD55C\uB2E4. \uC544\uB08C\uC5C6\uC774 \uB3C4\uC640\uC8FC\uBA74\uC11C \uB09C \uD604\uC7AC\uC5D0 \uC9D1\uC911\uC744 \uD558\uBA74\uC11C \uB354 \uD070 \uBBF8\uB798\uB97C \uC704\uD574 \uC804\uC9C4\uD558\uC790."));
